import Togglebutton from './Togglebutton';
import './Diagnose.css'


function Diagnose(){

    const [data, setData] = useState([{}]);
    var letter = ""
    var all = []

    useEffect(() => {
        fetch('/sys').then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                // console.log(data)
            }
        )  
    }, [])

    const diagnose=()=> {
    }

    return (
        <div className='Diagnose-page'>
            <div className='Diagnose-header'> 
                <h1>Select Symptoms: </h1>
            </div>

            <div className='Diagnose-header'>


                {(typeof data === "undefined") ? (
                    <p> Loading...</p>
                ) : (

                    data.map((item, i) => (

                        <div>
                            {(letter!==item[0][0]) ?
                                <h3>{item[0][0].toUpperCase()}</h3> : "" }

                            {(letter!==item[0][0]) ? 
                                (letter=item[0][0],
                                <Togglebutton name={item} category_same={false} arr={all} /> ): 
                                <Togglebutton name={item} category_same={true} arr={all} />
                            }

                        </div>
                    )),
                    console.log({all})
                )}

            </div>
            <div className='Diagnose-header'>   <button onClick={diagnose}>Done</button> </div>

        </div>
    );
}

export default Diagnose;
